class GeneratedLocalizationsDelegate extends LocalizationsDelegate<S> {
  const GeneratedLocalizationsDelegate();

  List<Locale> get supportedLocales {
    return const <Locale>[
      Locale("de", ""),
      Locale("fi", ""),
      Locale("sv", ""),
      Locale("pt", ""),
      Locale("en", ""),
      Locale("hr", ""),
      Locale("it", ""),
      Locale("fr", ""),
      Locale("es", ""),
      Locale("ar", ""),
      Locale("en", "GB"),
      Locale("pl", ""),
      Locale("he", ""),
      Locale("ro", ""),
      Locale("nl", ""),
      Locale("tr", ""),
    ];
  }

  LocaleListResolutionCallback listResolution({Locale fallback, bool withCountry = true}) {
    return (List<Locale> locales, Iterable<Locale> supported) {
      if (locales == null || locales.isEmpty) {
        return fallback ?? supported.first;
      } else {
        return _resolve(locales.first, fallback, supported, withCountry);
      }
    };
  }

  LocaleResolutionCallback resolution({Locale fallback, bool withCountry = true}) {
    return (Locale locale, Iterable<Locale> supported) {
      return _resolve(locale, fallback, supported, withCountry);
    };
  }

  @override
  Future<S> load(Locale locale) {
    final String lang = getLang(locale);
    if (lang != null) {
      switch (lang) {
        case "de":
          return SynchronousFuture<S>(const $de());
        case "fi":
          return SynchronousFuture<S>(const $fi());
        case "sv":
          return SynchronousFuture<S>(const $sv());
        case "pt":
          return SynchronousFuture<S>(const $pt());
        case "en":
          return SynchronousFuture<S>(const $en());
        case "hr":
          return SynchronousFuture<S>(const $hr());
        case "it":
          return SynchronousFuture<S>(const $it());
        case "fr":
          return SynchronousFuture<S>(const $fr());
        case "es":
          return SynchronousFuture<S>(const $es());
        case "ar":
          return SynchronousFuture<S>(const $ar());
        case "en_GB":
          return SynchronousFuture<S>(const $en_GB());
        case "pl":
          return SynchronousFuture<S>(const $pl());
        case "he":
          return SynchronousFuture<S>(const $he());
        case "ro":
          return SynchronousFuture<S>(const $ro());
        case "nl":
          return SynchronousFuture<S>(const $nl());
        case "tr":
          return SynchronousFuture<S>(const $tr());
        default:
          // NO-OP.
      }
    }
    return SynchronousFuture<S>(const S());
  }

  @override
  bool isSupported(Locale locale) => _isSupported(locale, true);

  @override
  bool shouldReload(GeneratedLocalizationsDelegate old) => false;

  ///
  /// Internal method to resolve a locale from a list of locales.
  ///
  Locale _resolve(Locale locale, Locale fallback, Iterable<Locale> supported, bool withCountry) {
    if (locale == null || !_isSupported(locale, withCountry)) {
      return fallback ?? supported.first;
    }

    final Locale languageLocale = Locale(locale.languageCode, "");
    if (supported.contains(locale)) {
      return locale;
    } else if (supported.contains(languageLocale)) {
      return languageLocale;
    } else {
      final Locale fallbackLocale = fallback ?? supported.first;
      return fallbackLocale;
    }
  }

  ///
  /// Returns true if the specified locale is supported, false otherwise.
  ///
  bool _isSupported(Locale locale, bool withCountry) {
    if (locale != null) {
      for (Locale supportedLocale in supportedLocales) {
        // Language must always match both locales.
        if (supportedLocale.languageCode != locale.languageCode) {
          continue;
        }

        // If country code matches, return this locale.
        if (supportedLocale.countryCode == locale.countryCode) {
          return true;
        }

        // If no country requirement is requested, check if this locale has no country.
        if (true != withCountry && (supportedLocale.countryCode == null || supportedLocale.countryCode.isEmpty)) {
          return true;
        }
      }
    }
    return false;
  }
}

String getLang(Locale l) => l == null
  ? null
  : l.countryCode != null && l.countryCode.isEmpty
    ? l.languageCode
    : l.toString();
